import React from "react";

function Login() {
    return (
        <div>
            Login
            <br></br>
            <button className="btn btn-primary">Button</button>
            <button className="btn w-64 rounded-full">버튼</button>
            <button className="btn btn-wide">test 버튼</button>
        </div>
    );
}

export default Login;
